import React from 'react';

function Navigation() {
  return (
    <div className="navigation" style={Styles.navigation}>
      <div className="log">
        <img alt="logo" src="../../public/assets/logo-name.png"></img>
      </div>
      <div classname="pageLinks">
        <a style={Styles.links}>ABOUT ME</a>
        <a style={Styles.links}>PORTFOLIO</a>
        <a style={Styles.links}>CONTACT</a>
      </div>
    </div>
  );
}

const Styles = {
  navigation: {
    display: "flex",
    flexDirection: "row",
    height: "10%"
  },
  links: {
    color: "gray",
    fontSize: "20px"  
  }
}
export default Navigation;
